package main

import "fmt"

func minOperationsMaxProfit(customers []int, boardingCost int, runningCost int) int {
	maxProfit, maxDepth := -1, 0
	profit, depth := 0, 0
	cusNum := len(customers)
	if cusNum == 0 {
		return -1
	}
	if boardingCost*4 <= runningCost {
		return -1
	}

	i, inLine := 0, 0

	for i < cusNum || inLine > 0 {
		depth++
		if i < cusNum {
			// v = customers[i]
			inLine += customers[i]
			i++
		} else {

			if inLine%4 == 0 {
				profit += inLine * (boardingCost - runningCost/4)
				depth += inLine/4 - 1
			} else {
				if inLine%4*boardingCost-runningCost > 0 {
					profit += inLine*boardingCost - inLine/4*runningCost - runningCost
					depth += inLine / 4
				} else {
					profit += (inLine - inLine%4) * (boardingCost - runningCost/4)
					depth += inLine/4 - 1
				}

			}
			inLine = 0
		}

		if inLine >= 4 {
			profit += 4*boardingCost - runningCost
			inLine -= 4
		} else {
			profit += inLine*boardingCost - runningCost
			inLine = 0
		}
		if profit > maxProfit {
			maxProfit = profit
			maxDepth = depth
		}
		fmt.Println(depth, profit, maxProfit, maxDepth, inLine)
	}
	if maxProfit > 0 {
		return maxDepth
	}
	return -1
}

